    "2013-03-15T14:34:50.386835",nt"name": "transother-atrlr",nt"isopen":
    false,nt"url": null,nt"notes": "The TransOther_ATRLR layer includes points
    depicting Automatic Traffice Recorder locations and associated traffic count information
    along local roads. The data includes traffic counts between 1975 and 2003. The points
    in this layer were generated using a variety of methods including GPS and on-screen
    digitizing with the TransRoad_RDS data layer in the background. Note: ATRLR includes
    data for a very limited number of municipalities (as of 5/10/2005). Additional municipalities
    may be added in the future.",nt"license_title": null,nt"extras": [{ntt"key":
